//////////////////////////////////////////////////////////////////////////////////
/// Help functions
//////////////////////////////////////////////////////////////////////////////////

void extractData(ReactionData *reaction, FILE *texFile) {
    char line[512];
    while (fgets(line, sizeof(line), texFile)) {
        if (strstr(line, "\\begin{small}\\begin{verbatim}") != NULL) {
            int i = 0;
            while (i < 9) {
                char *token = strtok(line, " \t\r\n");
                while (token != NULL && i < 9) {
                    if (strncmp(token, "b", 1) == 0) {
                        token = strtok(NULL, " \t\r\n"); // Move to the number after bX
                        if (token != NULL) {
                            sscanf(token, "%le", &reaction->values[i]);
                            i++;
                        }
                    }
                    token = strtok(NULL, " \t\r\n"); // Move to the next token
                }
                if (i < 9) {
                    if (!fgets(line, sizeof(line), texFile)) {
                        // Reached end of file or error reading
                        fprintf(stderr, "Error: Unexpected end of file or read error\n");
                        printf("i = %d\n", i);
                        printf("line = %s\n", line);
                        exit(EXIT_FAILURE);
                    }
                }
            }
            break;
        }
    }
}

void initReactionDataMap(char *fileName) {
    FILE *texFile = fopen(fileName, "r");
    if (texFile == NULL) {
        printf("Unable to open file\n");
        exit(EXIT_FAILURE);
    }

    char line[512];
    char target_section[] = "\\section{H.2  POLYNOMIAL FITS FOR $<\\sigma v>$ FOR FIXED $E$}";
    char target_reaction[20];
    printf("Extracting data from %s\n", fileName);

    while (fgets(line, sizeof(line), texFile) != NULL) {
        if (strstr(line, target_section) != NULL) {
            for (int i = 0; i < REAC_COUNT; i++) {
                sprintf(target_reaction, "Reaction %d.%d.%d%c",
                        reactionList[i].chapter,
                        reactionList[i].section,
                        reactionList[i].subsection,
                        reactionList[i].type);

                while (fgets(line, sizeof(line), texFile) != NULL) {
                    if (strstr(line, target_reaction) != NULL) {
                        extractData(&reactionData[i], texFile);
                        break;
                    }
                }
            }
        }
    }

    fclose(texFile);
}

double kcalc(double Rfit[9], double T) {
    double sum = 0;
    for (int i = 0; i < 9; ++i) { // cout << i << endl;
        sum = sum + Rfit[i] * pow(log(T), i);
    }
    // k=exp(sum( Rfit(n+1).*(log(T).^n)));

    return (exp(sum));
}

double kcalc2d(double Rfit2d[9][9], double E, double T) {
    double sum = 0;
    for (int i = 0; i < 9; ++i) {
        for (int j = 0; j < 9; ++j) {
            sum = sum + pow(log(T), i) * Rfit2d[i][j] * pow(log(E), j);
        }
    }
    // k=exp(sum(sum( diag(log(T).^n) * R218a * diag(log(E).^n))));
    return (exp(sum));
}

int findindex(double arr[], int size, double val) {
    int lowerindvalue = -1;
    // returns the lower index value
    if (val < arr[0])
        return -1;
    else if (val > arr[size - 1])
        return size;
    else {
        for (int ind = 0; ind < size; ++ind) {
            if (arr[ind] > val) {
                lowerindvalue = ind - 1;
                break;
            }
        }
        return lowerindvalue;
    }
}

double interpolate1D(double arrx[], double arrz[], int sizex, double valx) {
    // 1D linear interpolation
    double zip;
    int ind;
    if (valx <= arrx[0])
        zip = arrz[0];
    else if (valx >= arrx[sizex - 1])
        zip = arrz[sizex - 1];
    else {
        ind = findindex(arrx, sizex, valx);
        zip = arrz[ind] + (arrz[ind + 1] - arrz[ind]) * (valx - arrx[ind]) / (arrx[ind + 1] - arrx[ind]);
    }
    return zip;
}

